import React, { useState } from 'react';
import { 
  Typography, 
  Paper, 
  Button, 
  Box, 
  TextField, 
  CircularProgress,
  Card,
  CardContent,
  Divider,
  List,
  ListItem,
  ListItemText,
  Chip,
  Grid,
  FormControl,
  InputLabel,
  Select,
  MenuItem
} from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';

function LegalResearch() {
  const [query, setQuery] = useState('');
  const [isSearching, setIsSearching] = useState(false);
  const [isPredicting, setIsPredicting] = useState(false);
  const [searchResults, setSearchResults] = useState(null);
  const [prediction, setPrediction] = useState(null);
  const [llmModel, setLlmModel] = useState('gpt-4');
  const [selectedCase, setSelectedCase] = useState(null);

  const handleQueryChange = (event) => {
    setQuery(event.target.value);
  };

  const handleSearch = () => {
    if (!query.trim()) return;

    setIsSearching(true);

    // Simulate search delay
    setTimeout(() => {
      // Simulated search results
      setSearchResults([
        {
          id: '1',
          title: 'Smith v. Jones (2023)',
          content: 'The court ruled in favor of the plaintiff, finding that the defendant had breached the contract by failing to deliver the goods on time.',
          source: 'Supreme Court',
          relevance_score: 0.95
        },
        {
          id: '2',
          title: 'Wilson Corp v. Allen Inc (2022)',
          content: 'The court found that the non-compete clause was overly broad and therefore unenforceable under state law.',
          source: 'Court of Appeals',
          relevance_score: 0.87
        },
        {
          id: '3',
          title: 'Parker LLC v. Thompson (2021)',
          content: 'The court held that the defendant was not liable for damages as the force majeure clause in the contract covered the circumstances in question.',
          source: 'District Court',
          relevance_score: 0.82
        }
      ]);
      setIsSearching(false);
    }, 1500);
  };

  const handleCaseSelect = (caseItem) => {
    setSelectedCase(caseItem);
  };

  const handlePredict = () => {
    if (!selectedCase) return;

    setIsPredicting(true);

    // Simulate prediction delay
    setTimeout(() => {
      // Simulated prediction result
      setPrediction({
        prediction: "Based on the provided information and similar cases, the court is likely to rule in favor of the plaintiff.",
        confidence: 0.78,
        factors: [
          { name: "Precedent in similar cases", impact: "high" },
          { name: "Strength of evidence", impact: "medium" },
          { name: "Applicable statutes", impact: "medium" },
          { name: "Jurisdiction tendencies", impact: "low" }
        ],
        similar_cases: [
          { case_name: "Smith v. Jones (2023)", similarity: 0.85 },
          { case_name: "Wilson Corp v. Allen Inc (2022)", similarity: 0.72 },
          { case_name: "Parker LLC v. Thompson (2021)", similarity: 0.68 }
        ],
        llm_model: llmModel
      });
      setIsPredicting(false);
    }, 2000);
  };

  const getImpactColor = (impact) => {
    switch (impact) {
      case 'high':
        return 'error';
      case 'medium':
        return 'warning';
      case 'low':
        return 'info';
      default:
        return 'default';
    }
  };

  return (
    <Box>
      <Typography variant="h4" gutterBottom>
        Legal Research & Predictive Analytics
      </Typography>
      <Typography variant="body1" paragraph>
        Search for relevant legal cases and predict case outcomes using AI-powered analytics.
      </Typography>

      <Paper elevation={3} sx={{ p: 3, mb: 4 }}>
        <Typography variant="h6" gutterBottom>
          Search Legal Cases
        </Typography>

        <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
          <TextField
            fullWidth
            label="Enter legal query"
            variant="outlined"
            value={query}
            onChange={handleQueryChange}
            sx={{ mr: 2 }}
          />
          <Button 
            variant="contained" 
            color="primary" 
            onClick={handleSearch}
            disabled={!query.trim() || isSearching}
            startIcon={isSearching ? <CircularProgress size={20} /> : <SearchIcon />}
          >
            Search
          </Button>
        </Box>

        <FormControl fullWidth sx={{ mt: 2 }}>
          <InputLabel id="llm-model-label">LLM Model</InputLabel>
          <Select
            labelId="llm-model-label"
            id="llm-model-select"
            value={llmModel}
            label="LLM Model"
            onChange={(e) => setLlmModel(e.target.value)}
          >
            <MenuItem value="gpt-4">OpenAI GPT-4</MenuItem>
            <MenuItem value="gemini-pro">Google Gemini Pro</MenuItem>
            <MenuItem value="deepseek-chat">DeepSeek Chat</MenuItem>
          </Select>
        </FormControl>
      </Paper>

      {searchResults && (
        <Grid container spacing={3}>
          <Grid item xs={12} md={6}>
            <Card elevation={3}>
              <CardContent>
                <Typography variant="h6" gutterBottom>
                  Search Results
                </Typography>

                <List>
                  {searchResults.map((caseItem) => (
                    <React.Fragment key={caseItem.id}>
                      <ListItem 
                        button 
                        selected={selectedCase && selectedCase.id === caseItem.id}
                        onClick={() => handleCaseSelect(caseItem)}
                      >
                        <ListItemText 
                          primary={caseItem.title} 
                          secondary={
                            <>
                              <Typography variant="body2" component="span">
                                {caseItem.content.substring(0, 100)}...
                              </Typography>
                              <Box sx={{ display: 'flex', alignItems: 'center', mt: 1 }}>
                                <Chip 
                                  label={caseItem.source} 
                                  size="small" 
                                  sx={{ mr: 1 }} 
                                />
                                <Chip 
                                  label={`Relevance: ${Math.round(caseItem.relevance_score * 100)}%`} 
                                  size="small" 
                                  color="primary" 
                                  variant="outlined" 
                                />
                              </Box>
                            </>
                          }
                        />
                      </ListItem>
                      <Divider component="li" />
                    </React.Fragment>
                  ))}
                </List>

                <Box sx={{ mt: 2 }}>
                  <Button 
                    variant="contained" 
                    color="secondary" 
                    onClick={handlePredict}
                    disabled={!selectedCase || isPredicting}
                    fullWidth
                  >
                    {isPredicting ? <CircularProgress size={24} /> : 'Predict Outcome'}
                  </Button>
                </Box>
              </CardContent>
            </Card>
          </Grid>

          {prediction && (
            <Grid item xs={12} md={6}>
              <Card elevation={3}>
                <CardContent>
                  <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 2 }}>
                    <Typography variant="h6">Case Prediction</Typography>
                    <Chip label={`Model: ${prediction.llm_model}`} color="primary" variant="outlined" />
                  </Box>

                  <Typography variant="subtitle1" gutterBottom>
                    Prediction
                  </Typography>
                  <Typography variant="body1" paragraph>
                    {prediction.prediction}
                  </Typography>

                  <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                    <Typography variant="subtitle2" sx={{ mr: 1 }}>
                      Confidence:
                    </Typography>
                    <Chip 
                      label={`${Math.round(prediction.confidence * 100)}%`} 
                      color={prediction.confidence > 0.7 ? "success" : "warning"} 
                    />
                  </Box>

                  <Divider sx={{ my: 2 }} />

                  <Typography variant="subtitle1" gutterBottom>
                    Influential Factors
                  </Typography>
                  <List dense>
                    {prediction.factors.map((factor, index) => (
                      <ListItem key={index}>
                        <ListItemText 
                          primary={factor.name} 
                          secondary={
                            <Chip 
                              label={`Impact: ${factor.impact}`} 
                              size="small" 
                              color={getImpactColor(factor.impact)} 
                            />
                          } 
                        />
                      </ListItem>
                    ))}
                  </List>

                  <Divider sx={{ my: 2 }} />

                  <Typography variant="subtitle1" gutterBottom>
                    Similar Cases
                  </Typography>
                  <List dense>
                    {prediction.similar_cases.map((similarCase, index) => (
                      <ListItem key={index}>
                        <ListItemText 
                          primary={similarCase.case_name} 
                          secondary={`Similarity: ${Math.round(similarCase.similarity * 100)}%`} 
                        />
                      </ListItem>
                    ))}
                  </List>
                </CardContent>
              </Card>
            </Grid>
          )}
        </Grid>
      )}
    </Box>
  );
}

export default LegalResearch;
